DROP VIEW IF EXISTS `coursetable`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `coursetable` AS select `course`.`CID` AS `CID`,`course`.`CNAME` AS `CNAME`,`course`.`CPLACE` AS `CPLACE`,`student`.`SID` AS `SID`,`student`.`SNAME` AS `SNAME`,`teacher`.`TID` AS `TID`,`teacher`.`TNAME` AS `TNAME`,`studenthistory`.`WEEKDAY` AS `WEEKDAY`,`studenthistory`.`CLASSTIME` AS `CLASSTIME`,`studenthistory`.`CLASSINDEX` AS `CLASSINDEX`,`studenthistory`.`CHECKORNOT` AS `CHECKORNOT` from (((`course` join `studenthistory`) join `teacher`) join `student`) where ((`course`.`CID` = `studenthistory`.`CID`) and (`course`.`TID` = `teacher`.`TID`) and (`student`.`SID` = `studenthistory`.`SID`) and (`studenthistory`.`WEEKDAY` = `course`.`WEEKDAY`)) order by `course`.`CID` desc,`student`.`SID`,`studenthistory`.`CLASSTIME` desc,`studenthistory`.`CLASSINDEX` desc ;
